TITLE:
  - testing reinitialization by distance to interface
  - 'additional checking various options: REINITBAND and REINITVOLCORRECTION'
  - 'note: compared to the original level-set in the combustion modul,'
  - volume correction is here also performed after initial reinitialization
PROBLEM TYPE:
  PROBLEMTYPE: "Level_Set"
LEVEL-SET CONTROL:
  NUMSTEP: 20
  TIMESTEP: 0.4
  MAXTIME: 40
  RESTARTEVERY: 10
LEVEL-SET CONTROL/REINITIALIZATION:
  REINITIALIZATION: "Signed_Distance_Function"
  REINIT_INITIAL: true
  REINITBAND: true
  REINITBANDWIDTH: 0.2
  REINITVOLCORRECTION: true
SCALAR TRANSPORT DYNAMIC:
