  RESTARTEVERY: 20
  MATID: 1
  VELOCITYFIELD: "function"
  VELFUNCNO: 1
  INITIALFIELD: "field_by_function"
  INITFUNCNO: 3
  LINEAR_SOLVER: 1
SCALAR TRANSPORT DYNAMIC/NONLINEAR:
  ITEMAX: 20
  CONVTOL: 1e-05
SCALAR TRANSPORT DYNAMIC/STABILIZATION:
  DEFINITION_TAU: "Taylor_Hughes_Zarins"
SOLVER 1:
